	} else {
		throw 'Unsupported DB type: ' + dbType;
	}
}

/**
	Supports parsing date strings in a variety of formats and outputting the date in a specific format.
*/
var patterns = [
	"yyyy-MM-dd HH:mm:ss.SSSSSSS ZZ",
	"yyyy-MM-dd'T'HH:mm:ss.SSSZ",
	"yyyy-MM-dd'T'HH:mm:ssZ",
	"yyyy-MM-dd'T'HH:mm:ss",
	"yyyy-MM-dd'T'HH:mm",
	'yyyy-MM-dd',
	'yyyy-MM-dd HH:mm:ss:SSS',
	'yyyy-MM-dd HH:mm:ss.SSS',
	'yyyy-MM-dd HH:mm:ss',
	'yyyy-MM-dd HH:mm',
	'EEE MMM dd HH:mm:ss:SSS zzz yyyy',
	'EEE MMM dd HH:mm:ss.SSS zzz yyyy',
	'EEE MMM dd HH:mm:ss zzz yyyy',
	'EEE MMM dd zzz yyyy',
	'dd-MMM-yyyy HH:mm:ss:SSS',
	'dd-MMM-yyyy HH:mm:ss.SSS',
	'dd-MMM-yyyy HH:mm:ss',
	'yyyy MM dd',
	'yyyy.MM.dd',
	'MM-dd-yyyy',
	'MM dd yyyy',
	'MM.dd.yyyy',
	'HH:mm:ss:SSS',
	'HH:mm:ss.SSS',
	'HH:mm:ss',
	'yyyyMMddHHmmssSSS',
	'yyyyMMddHHmmss',
	'yyyyMMddHHmm',
	'hh:mm aa'];

var formatters = [];
for each (pattern in patterns) {
	formatters.push(org.joda.time.format.DateTimeFormat.forPattern(pattern));
}

function getMillis(date) {
	var instant = 0;
	if (typeof date == 'number' || date instanceof java.lang.Number)
		instant = new Number(date);
	else if (date instanceof Date || date instanceof java.util.Date)
		instant = date.getTime();
	else if (date instanceof org.joda.time.ReadableInstant)
		instant = date.getMillis();
	else {
		for each (formatter in formatters) {
			try {
				instant = formatter.parseMillis(new String(date));
				break;
			} catch(e) {}
		}
	}

	return instant;
}

function getDate(date) {
	return new java.util.Date(getMillis(date));
}

function convertDate(date, outpattern) {
	return org.joda.time.format.DateTimeFormat.forPattern(outpattern).print(getMillis(date));
}

/**
	Creates a FHIR OperationOutcome resource and adds it to the response map with the key "response".

	@param {String} severity - Indicates whether the issue indicates a variation from successful
		processing. Values: fatal | error | warning | information
	@param {String} code - Describes the type of the issue. The system that creates an
		OperationOutcome SHALL choose the most applicable code from the IssueType value set, and may
		additional provide its own code for the error in the details element. Values: invalid | security |
		processing | transient | informational
	@param {String} details - Additional details about the error. This may be a text description of
		the error, or a system code that identifies the error.
	@param {int} httpStatusCode - The HTTP status code to send back with the response. Defaults to 400
		if not specified.
	@param {Error} e - If included, this will be used to build up the response status message and
		error.
	@param {Boolean} isFormatXML - If true, the resource will be formatted in XML. Otherwise, it will
		be formatted in JSON. If not specified, it will attempt to find the _format parameter in the source
		map, or return JSON.
	@return {Response} The created Response object.
*/
function createOperationOutcome(severity, code, details, httpStatusCode, e, isFormatXML) {
	if (!httpStatusCode) {
		httpStatusCode = 400;
	}

	if (!isFormatXML && $s('parameters') && $s('parameters').contains('_format')) {
		isFormatXML = !FhirUtil.isJSON($s('parameters').getParameter('_format'));
	}

	var outcome = FhirUtil.createOperationOutcome(severity, code, details);
	var message = isFormatXML ? FhirUtil.toXML(outcome) : FhirUtil.toJSON(outcome);
	responseMap.put('response', FhirResponseFactory.getResponse(message, httpStatusCode, isFormatXML ? FhirUtil.getMIMETypeXML() : FhirUtil.getMIMETypeJSON()));
	var response = new Response(message);
	response.setStatusMessage(severity.toUpperCase() + ' OperationOutcome created with status ' + httpStatusCode + '.');

	if (httpStatusCode >= 400) {
		response.setStatus(Status.ERROR);

		if (e) {
			var customMessage = 'Channel ' + channelName + ': ';
			if (e.rhinoException) {
				customMessage += 'Error on line ' + e.rhinoException.lineNumber() + ': ';
			}
			customMessage += e.toString();

			var errorContent = com.mirth.connect.util.ErrorMessageBuilder.buildErrorMessage('FHIR Listener', customMessage, e.javaException || null);
			if (e.javaException) {
				logger.error(errorContent, e.javaException);	
			} else {
				logger.error(errorContent);
			}
			response.setError(errorContent);
		}
	}

	return response;
}

/**
	Returns the "return" element of the Prefer HTTP header if specified.

	@return {String} The "return" element of the Prefer header, or undefined if not present
*/
function getPreferValue() {
	var preferReturn;
	var preferHeader = $('headers').getHeader('Prefer');

	if (preferHeader) {
		for each (element in new org.apache.http.message.BasicHeader('Prefer', preferHeader).getElements()) {
			if (element.getName() == 'return') {
				preferReturn = element.getValue();
				break;
			}
		}
	}

	return preferReturn;
}

/**
	Imports HAPI FHIR packages commonly used in the FHIR Listener channel.
*/
importPackage(Packages.ca.uhn.fhir.model.api);
importPackage(Packages.ca.uhn.fhir.model.base.resource);
importPackage(Packages.ca.uhn.fhir.model.primitive);
importPackage(Packages.org.hl7.fhir.dstu3.model);
importPackage(org.apache.commons.lang3);
importPackage(org.apache.commons.lang3.math);

/**
	Sets the resource ID, version ID, and last updated date/time.

	@param {IBaseResource} resource - The FHIR resource object.
	@param {String} id - The logical ID of the resource.
	@param {Number} versionId - The version ID of the resource.
	@return {Date} The last updated date/time.
*/
function updateResourceMeta(resource, id, versionId) {
	resource.setId(id);
	resource.getMeta().setVersionId(new String(versionId));
	var lastUpdated = new java.util.Date();
	resource.getMeta().getLastUpdatedElement().setTimeZone(java.util.TimeZone.getDefault());
	resource.getMeta().setLastUpdated(lastUpdated);
	return lastUpdated;
}

/**
	Builds AllergyIntolerance FHIR Resource that adheres to its Care-Connect profile,
	see https://fhir.hl7.org.uk/STU3/StructureDefinition/CareConnect-AllergyIntolerance-1 for more info.

	@author Frazer Smith
	@param {Object} data - Java RowSet object.
	@return {Object} AllergyIntolerance FHIR resource.
 */
function buildAllergyIntoleranceResource(data) {
	/**
	 * Hard-coding meta profile and resourceType into resource as this should not
	 * be changed for this resource, ever.
	 */
	var resource = {
		meta: {
			profile: [
				'https://fhir.hl7.org.uk/STU3/StructureDefinition/CareConnect-AllergyIntolerance-1'
			]
		},
		resourceType: 'AllergyIntolerance'
	};

	// Add meta data
	if (getResultSetString(data, 'lastUpdated') != undefined
		&& getResultSetString(data, 'lastUpdated').substring(0, 1) != 'T'
		&& getResultSetString(data, 'lastUpdated').substring(0, 4) != '1900') {
		resource.meta.lastUpdated = getResultSetString(data, 'lastUpdated');
	}

	resource.id = newStringOrUndefined(getResultSetString(data, 'id'));
	resource.assertedDate = newStringOrUndefined(getResultSetString(data, 'assertedDate'));

	// Very unlikely that an allergy record will have multiple components like this
	// but better to be safe than sorry
	var result = [];
	result.push(newStringOrUndefined(getResultSetString(data, 'allergyGroupDesc')));
	result.push(newStringOrUndefined(getResultSetString(data, 'allergyCodingDesc')));
	result.push(newStringOrUndefined(getResultSetString(data, 'allergyDrugDesc')));
	result.push(newStringOrUndefined(getResultSetString(data, 'allergyDrugGenericDesc')));
	result.push(newStringOrUndefined(getResultSetString(data, 'allergyDrugCategoryDesc')));
	result.push(newStringOrUndefined(getResultSetString(data, 'allergyDrugFormDesc')));
	result.push(newStringOrUndefined(getResultSetString(data, 'allergyDrugIngredientDesc')));
	result.push(newStringOrUndefined(getResultSetString(data, 'allergyComment')));
	result = result.filter((el) => el != null);
	if (result.length > 0) {
		resource.code = {
			text: result.join('; ')
		};
	}

	resource.patient = {
		reference: $cfg('apiUrl') + '/r3/patient/' + getResultSetString(data, 'patientReference')
	};

	resource.clinicalStatus = newStringOrUndefined(getResultSetString(data, 'clinicalStatusCode'));
	resource.verificationStatus = newStringOrUndefined(getResultSetString(data, 'verificationStatusCode'));
	resource.type = newStringOrUndefined(getResultSetString(data, 'typeCode'));
	resource.criticality = newStringOrUndefined(getResultSetString(data, 'criticalityCode'));

	return resource;
}

/**
	Builds Bundle FHIR Resource that adheres to the HL7 spec,
	see https://www.hl7.org/fhir/STU3/bundle.html for more info.

	@author Frazer Smith
	@param {string} requestUrl - URL that GET request was made to.
	@return {Object} Bundle FHIR resource.
 */
function buildBundleResource(requestUrl) {
	var resource = {
		resourceType: newStringOrUndefined('Bundle'),
		type: newStringOrUndefined('searchset'),
		total: 0,
		link: [],
		entry: []
	};
	// Add link URL
	if (requestUrl) {
		var linkEntry = {
			relation: newStringOrUndefined('self'),
			url: newStringOrUndefined(requestUrl)
		};

		resource.link.push(linkEntry);
	}

	return resource;
}

/**
	Builds Encounter FHIR Resource that adheres to its Care-Connect profile,
	see https://fhir.hl7.org.uk/STU3/StructureDefinition/CareConnect-Encounter-1 for more info.

	@author Frazer Smith
	@param {Object} data - Java RowSet object.
	@return {Object} Encounter FHIR resource.
 */
function buildEncounterResource(data) {
	/**
	 * Hard-coding meta profile and resourceType into resource as this should not
	 * be changed for this resource, ever.
	 */
	var resource = {
		meta: {
			profile: [
				'https://fhir.hl7.org.uk/STU3/StructureDefinition/CareConnect-Encounter-1'
			]
		},
		resourceType: 'Encounter'
	};

	resource.id = newStringOrUndefined(getResultSetString(data, 'encounterIdentifier'));
	resource.status = newStringOrUndefined(getResultSetString(data, 'encounterStatusMapped'));

	// Add meta data
	if (getResultSetString(data, 'lastUpdated') != undefined
		&& getResultSetString(data, 'lastUpdated').substring(0, 1) != 'T'
		&& getResultSetString(data, 'lastUpdated').substring(0, 4) != '1900') {
		resource.meta.lastUpdated = getResultSetString(data, 'lastUpdated');
	}

	if (getResultSetString(data, 'encounterClassDesc') != undefined) {
		resource.class = {
			system: 'http://hl7.org/fhir/v3/ActEncounterCode',
			code: newStringOrUndefined(getResultSetString(data, 'encounterClassCode')),
			display: newStringOrUndefined(getResultSetString(data, 'encounterClassDesc'))
		};
	}

	if (getResultSetString(data, 'encounterTypeCode') != undefined) {
		resource.type = {
			coding: [{
				system: 'https://fhir.nhs.uk/STU3/CodeSystem/DCH-Specialty-1',
				code: newStringOrUndefined(getResultSetString(data, 'encounterTypeCode')),
				display: newStringOrUndefined(getResultSetString(data, 'encounterTypeDesc'))
			}]
		};
	}

	resource.period = {};
	if (getResultSetString(data, 'encounterPeriodStart') != undefined
		&& getResultSetString(data, 'encounterPeriodStart').substring(0, 1) != 'T'
		&& getResultSetString(data, 'encounterPeriodStart').substring(0, 4) != '1900') {
		resource.period.start = getResultSetString(data, 'encounterPeriodStart');
	}
	if (getResultSetString(data, 'encounterPeriodEnd') != undefined
		&& getResultSetString(data, 'encounterPeriodEnd').substring(0, 1) != 'T'
		&& getResultSetString(data, 'encounterPeriodEnd').substring(0, 4) != '1900') {
		resource.period.end = getResultSetString(data, 'encounterPeriodEnd');
	}

	resource.subject = {
		reference: $cfg('apiUrl') + '/r3/patient/' + getResultSetString(data, 'subjectReference')
	};

	return resource;
}

/**
	Builds Patient FHIR resource that adheres to its Care-Connect profile,
	see https://fhir.hl7.org.uk/STU3/StructureDefinition/CareConnect-Patient-1 for more info.

	@author Frazer Smith
	@param {Object} data - Java RowSet object.
	@return {Object} Patient FHIR resource.
 */
function buildPatientResource(data) {
	var result = {};
	result.lastUpdated = getResultSetString(data, 'lastUpdated');
	result.nhsNumber = getResultSetString(data, 'nhsNumber');
	result.nhsNumberTraceStatusCode = getResultSetString(data, 'nhsNumberTraceStatusCode');
	result.nhsNumberTraceStatusDesc = getResultSetString(data, 'nhsNumberTraceStatusDesc');
	if (result.nhsNumberTraceStatusCode == undefined) {
		result.nhsNumberTraceStatusCode = '2';
		result.nhsNumberTraceStatusDesc = 'Number present but not traced';
	}
	result.gpName = getResultSetString(data, 'gpDesc');
	result.gpAddressLine1 = getResultSetString(data, 'gpAddressLine1');
	result.gpAddressLine2 = getResultSetString(data, 'gpAddressLine2');
	result.gpCity = getResultSetString(data, 'gpCity');
	result.gpPostalCode = getResultSetString(data, 'gpPostalCode');
	result.gpIdentifier = getResultSetString(data, 'gpIdentifier');
	result.patientNo = getResultSetString(data, 'PatientNo');
	result.active = getResultSetString(data, 'active');
	result.ethnicCategoryDesc = getResultSetString(data, 'ethnicCategoryDesc');
	result.ethnicCategoryCode = getResultSetString(data, 'ethnicCategoryCode');
	result.homePhone = getResultSetString(data, 'homePhone');
	result.businessPhone = getResultSetString(data, 'businessPhone');
	result.mobilePhone = getResultSetString(data, 'mobilePhone');
	result.appointmentSMS = getResultSetString(data, 'appointmentSMS');
	result.email = getResultSetString(data, 'email');
	result.preferredContactMethod = getResultSetString(data, 'preferredContactMethod');
	result.preferredLanguage = getResultSetString(data, 'preferredLanguage');
	result.interpreterRequired = getResultSetString(data, 'interpreterRequired');
	result.nameFamily = getResultSetString(data, 'nameFamily');
	result.nameGiven1First = getResultSetString(data, 'nameGiven1First');
	result.nameGiven2Middle = getResultSetString(data, 'nameGiven2Middle');
	result.namePrefix = getResultSetString(data, 'namePrefix');
	result.maritalStatusDesc = getResultSetString(data, 'maritalStatusDesc');
	result.maritalStatusCode = getResultSetString(data, 'maritalStatusCode');
	result.addressLine1 = getResultSetString(data, 'addressLine1');
	result.addressLine2 = getResultSetString(data, 'addressLine2');
	result.city = getResultSetString(data, 'city');
	result.district = getResultSetString(data, 'district');
	result.postalCode = getResultSetString(data, 'postalCode');
	result.gender = getResultSetString(data, 'gender');
	result.birthdate = getResultSetString(data, 'birthdate');
	result.deceased = getResultSetString(data, 'deceased');
	if (result.deceased == undefined) {
		result.deceased = false;
	} else {
		result.deceased = true;
	}

	result.contactName = getResultSetString(data, 'contactName');
	result.contactPhone = getResultSetString(data, 'contactPhone');
	result.contactText = getResultSetString(data, 'contactText');
	result.DND = getResultSetString(data, 'DND'); // restricted patient

	/**
	 * Hard-coding meta profile and resourceType into resource as this should not
	 * be changed for this resource, ever.
	 */
	var resource = {
		fullUrl: $cfg('apiUrl') + $('contextPath') + '/' + result.patientNo,
		meta: {
			profile: [
				'https://fhir.hl7.org.uk/STU3/StructureDefinition/CareConnect-Patient-1'
			]
		},
		resourceType: newStringOrUndefined('Patient'),
		identifier: [{
			use: newStringOrUndefined('usual'),
			system: newStringOrUndefined('https://fhir.ydh.nhs.uk/Id/local-patient-identifier'),
			value: newStringOrUndefined(result.patientNo)
		}],
		name: [{
			use: newStringOrUndefined('usual'),
			family: newStringOrUndefined(result.nameFamily),
			given: result.nameGiven1First,
			prefix: result.namePrefix
		}],
		gender: newStringOrUndefined(result.gender),
		birthDate: newStringOrUndefined(result.birthdate),
		deceasedBoolean: newBooleanOrUndefined(result.deceased),
		address: [{
			use: newStringOrUndefined('home'),
			type: newStringOrUndefined('postal'),
			line: [
				newStringOrUndefined(result.addressLine1),
				newStringOrUndefined(result.addressLine2)
			],
			city: newStringOrUndefined(result.city),
			district: newStringOrUndefined(result.district),
			postalCode: newStringOrUndefined(result.postalCode)
		}],
		id: newStringOrUndefined(result.patientNo),
		language: newStringOrUndefined('English (Great Britain)')
	};

	// Add meta data
	if (result.lastUpdated != undefined
		&& result.lastUpdated.substring(0, 1) != 'T'
		&& result.lastUpdated.substring(0, 1) != '1900') {
		resource.meta.lastUpdated = newStringOrUndefined(result.lastUpdated);
	}

	// Add NHS No
	if (result.nhsNumber != undefined) {
		var nhsIdentifier = {
			use: newStringOrUndefined('official'),
			system: newStringOrUndefined('https://fhir.nhs.uk/Id/nhs-number'),
			value: newStringOrUndefined(result.nhsNumber),
			extension: [{
				url: newStringOrUndefined('https://fhir.hl7.org.uk/STU3/StructureDefinition/Extension-CareConnect-NHSNumberVerificationStatus-1'),
				valueCodeableConcept: {
					coding: [{
						system: newStringOrUndefined('https://fhir.hl7.org.uk/STU3/CodeSystem/CareConnect-NHSNumberVerificationStatus-1'),
						code: newStringOrUndefined(result.nhsNumberTraceStatusCode),
						display: newStringOrUndefined(result.nhsNumberTraceStatusDesc)

					}]
				}
			}]
		};
		resource.identifier.push(nhsIdentifier);
	}

	// Add Next of kin contact details
	if (result.contactName != undefined) {
		var contact = {
			relationship: {
				coding: [
					{
						system: 'http://hl7.org/fhir/v2/0131',
						code: 'N',
						display: 'Next-of-kin'
					}
				]
			},
			name: [
				{
					use: 'usual',
					text: newStringOrUndefined(result.contactName)
				}
			]
		};

		if (result.contactPhone != undefined) {
			var contactTelecom = [
				{
					system: 'phone',
					value: newStringOrUndefined(result.contactPhone)
				}
			];
			contact.telecom = contactTelecom;
		}

		resource.contact = contact;
	}

	// Add Telecom contact details
	var telecom = [];
	if (result.homePhone != undefined) {
		var homePhone = {
			system: newStringOrUndefined('phone'),
			value: newStringOrUndefined(result.homePhone),
			use: newStringOrUndefined('home')
		};
		telecom.push(homePhone);
	}
	if (result.mobilePhone != undefined) {
		var mobilePhone = {
			system: newStringOrUndefined('phone'),
			value: newStringOrUndefined(result.mobilePhone),
			use: newStringOrUndefined('mobile')
		};
		telecom.push(mobilePhone);
	}
	if (result.email != undefined) {
		var email = {
			system: newStringOrUndefined('email'),
			value: newStringOrUndefined(result.email)
		};
		telecom.push(email);
	}
	if (telecom.length > 0) {
		resource.telecom = telecom;
	}

	// Add Ethnical Category
	var extension = [];
	if (result.ethnicCategoryCode != undefined) {
		var ethCatExtension = {
			url: newStringOrUndefined('https://fhir.hl7.org.uk/STU3/StructureDefinition/Extension-CareConnect-EthnicCategory-1'),
			valueCodeableConcept: {
				coding: [{
					system: newStringOrUndefined('https://fhir.hl7.org.uk/STU3/CodeSystem/CareConnect-EthnicCategory-1'),
					code: newStringOrUndefined(result.ethnicCategoryCode),
					display: newStringOrUndefined(result.ethnicCategoryDesc)
				}]
			}
		};
		extension.push(ethCatExtension);
	}
	if (extension.length > 0) {
		resource.extension = extension;
	}

	// Add contained GP organization resource
	var contained = [];
	if (result.gpIdentifier != undefined) {
		var containedOrganisation = {
			resourceType: 'Organization',
			id: newStringOrUndefined(result.gpIdentifier),
			meta: {
				profile: [
					'https://fhir.hl7.org.uk/STU3/StructureDefinition/CareConnect-Organization-1'
				]
			},
			name: newStringOrUndefined(result.gpName),
			address: [{
				use: newStringOrUndefined('work'),
				type: newStringOrUndefined('both'),
				line: [
					newStringOrUndefined(result.gpAddressLine1),
					newStringOrUndefined(result.gpAddressLine2)
				],
				city: newStringOrUndefined(result.gpCity),
				postalCode: newStringOrUndefined(result.gpPostalCode)
			}]
		};
		contained.push(containedOrganisation);
	}
	if (contained.length > 0) {
		resource.contained = contained;
	}

	// Add GP
	var generalPractitioner = [];
	if (result.gpIdentifier != undefined) {
		var gpReference = {
			reference: newStringOrUndefined('#' + result.gpIdentifier),
			display: newStringOrUndefined(result.gpName)
		};
		generalPractitioner.push(gpReference);
	}

	if (generalPractitioner.length > 0) {
		resource.generalPractitioner = generalPractitioner;
	}

	// Add Marital Status
	if (result.maritalStatusCode != undefined && result.maritalStatusDesc != undefined) {
		resource.maritalStatus = {
			coding: [{
				system: newStringOrUndefined('http://hl7.org/fhir/stu3/v3/MaritalStatus'),
				code: newStringOrUndefined(result.maritalStatusCode),
				display: newStringOrUndefined(result.maritalStatusDesc)
			}]
		};
	}

	// If patient has a 'Do Not Distribute Patient Address' alert, strip out contact details
	if (result.DND != undefined) {
		delete resource.telecom;
		delete resource.address;
		resource.meta.security = [{
			system: 'http://hl7.org/fhir/ValueSet/v3-Confidentiality',
			code: 'R',
			display: 'restricted'
		}];
	}

	return resource;
}

/* eslint-disable quotes */

/**
	Queries database for data needed to build FHIR resource.

	@author Frazer Smith
	@param {string} type - Resource name.
	@param {Object} params - An array of predicates to be added to SQL queries.
	@return {Object} Java ResultSet object.
 */
function buildResourceQuery(type, params) {
	// type is Java object so has to be coerced to a JS object by adding an empty string
	switch (type + '') {
	case 'allergyintolerance':
		return executeCachedQuery("SELECT DISTINCT id, patientReference, allergyGroupDesc, allergyCodingDesc, allergyDrugDesc, allergyDrugGenericDesc, allergyDrugCategoryDesc, allergyDrugFormDesc, allergyDrugIngredientDesc, allergyComment, clinicalStatusCode, verificationStatusCode, typeCode, criticalityCode, CONCAT(COALESCE(assertedDate, ''), 'T', COALESCE(assertedTime, '')) AS assertedDate, CONCAT(COALESCE(lastUpdateDate, ''), 'T', COALESCE(lastUpdateTime, '')) AS lastUpdated FROM OPENQUERY([ENYH-PRD-ANALYTICS], 'SELECT DISTINCT REPLACE(alle.ALG_RowId, ''||'', ''-'') AS id, alle.ALG_PAPMI_ParRef->PAPMI_No AS patientReference, alle.ALG_AllergyGrp_DR->ALGR_Desc AS allergyGroupDesc, alle.ALG_TYPE_DR->ALG_Desc AS allergyCodingDesc, alle.ALG_PHCDM_DR->PHCD_ProductName AS allergyDrugDesc, alle.ALG_PHCGE_DR->PHCGE_Name AS allergyDrugGenericDesc, alle.ALG_PHCSC_DR->PHCSC_Desc AS allergyDrugCategoryDesc, alle.ALG_PHCDRGForm_DR->PHCDF_Description AS allergyDrugFormDesc, alle.ALG_Ingred_DR->INGR_Desc AS allergyDrugIngredientDesc, alle.ALG_Comments AS allergyComment, CASE alle.ALG_Status WHEN ''A'' THEN ''active'' WHEN ''I'' THEN ''inactive'' WHEN ''R'' THEN ''resolved'' ELSE NULL END AS clinicalStatusCode, CASE WHEN alle.ALG_Status = ''C'' THEN ''unconfirmed'' WHEN alle.ALG_ConfirmedDate IS NOT NULL OR (alle.ALG_Status != ''C'' AND alle.ALG_Status IS NOT NULL) THEN ''confirmed'' ELSE ''unconfirmed'' END as verificationStatusCode, CASE alle.ALG_Category_DR->ALRGCAT_DESC WHEN ''ALLERGY'' THEN ''allergy'' WHEN ''SIDEEFFECT'' THEN ''intolerance'' ELSE NULL END AS typeCode, CASE alle.ALG_Severity_DR WHEN 1 THEN ''high'' WHEN 2 THEN ''low'' WHEN 5 THEN ''high'' WHEN 4 THEN ''unable-to-assess'' ELSE NULL END AS criticalityCode, alle.ALG_Date AS assertedDate, alle.ALG_Time AS assertedTime, alle.ALG_LastUpdateDate AS lastUpdateDate, alle.ALG_LastUpdateTime as lastUpdateTime FROM %ALLINDEX PA_Allergy alle WHERE " + params[0] + " AND (alle.ALG_PAPMI_ParRef->PAPMI_No IS NOT NULL)' );");
	case 'condition':
		return executeCachedQuery();
	case 'documentreference':
		return executeCachedQuery();
	case 'encounter':
		return executeCachedQuery("WITH encounter_CTE(encounterIdentifier, encounterClassDesc, encounterClassCode, encounterTypeDesc, encounterTypeCode, encounterPeriodStartDate, encounterPeriodStartTime, encounterPeriodEndDate, encounterPeriodEndTime, subjectReference, encounterStatus, lastUpdateDate, lastUpdateTime) AS (SELECT DISTINCT * FROM OPENQUERY([ENYH-PRD-ANALYTICS], 'SELECT REPLACE(app.APPT_RowId, ''||'', ''-'') AS encounterIdentifier, ''outpatient'' AS encounterClassDesc, NULL AS encounterClassCode, app.APPT_AS_ParRef->AS_RES_ParRef->RES_CTLOC_DR->CTLOC_Desc AS encounterTypeDesc, app.APPT_AS_ParRef->AS_RES_ParRef->RES_CTLOC_DR->CTLOC_Code AS encounterTypeCode, COALESCE(app.APPT_ArrivalDate, app.APPT_DateComp) AS encounterPeriodStartDate, COALESCE(app.APPT_ArrivalTime, app.APPT_TimeComp) AS encounterPeriodStartTime, NULL AS encounterPeriodEndDate, NULL AS encounterPeriodEndTime, app.APPT_Adm_DR->PAADM_PAPMI_DR->PAPMI_No AS subjectReference, app.APPT_Status AS encounterStatus, app.APPT_LastUpdateDate AS lastUpdateDate, NULL AS lastUpdateTime FROM RB_Appointment app WHERE " + params[0] + " AND app.APPT_Adm_DR->PAADM_PAPMI_DR->PAPMI_No IS NOT NULL ') UNION SELECT DISTINCT * FROM OPENQUERY([ENYH-PRD-ANALYTICS], 'SELECT REPLACE(PAADM_ADMNo, ''/'', ''-'') AS encounterIdentifier, CASE PAADM_Type WHEN ''I'' THEN ''inpatient'' WHEN ''E'' THEN ''emergency'' END as encounterClassDesc, CASE PAADM_Type WHEN ''I'' THEN ''IMP'' WHEN ''E'' THEN ''EMER'' END as encounterClassCode, PAADM_DepCode_DR->CTLOC_Desc AS encounterTypeDesc, PAADM_DepCode_DR->CTLOC_Code AS encounterTypeCode, PAADM_AdmDate AS encounterPeriodStartDate, PAADM_AdmTime AS encounterPeriodStartTime, PAADM_DischgDate AS encounterPeriodEndDate, PAADM_DischgTime AS encounterPeriodEndTime, PAADM_PAPMI_DR->PAPMI_No AS subjectReference, PAADM_VisitStatus AS encounterStatus, PAADM_UpdateDate AS lastUpdateDate, PAADM_UpdateTime AS lastUpdateTime FROM PA_Adm WHERE PAADM_Type IN (''I'', ''E'') AND " + params[1] + " AND PAADM_PAPMI_DR->PAPMI_No IS NOT NULL ')) SELECT encounterIdentifier, CASE WHEN encounterStatus IN ('C', 'N', 'X', 'T', 'J', 'H') THEN 'cancelled' WHEN encounterStatus IN ('D', 'R') OR (encounterStatus IN ('A') AND encounterPeriodStartDate IS NOT NULL AND encounterPeriodEndDate IS NOT NULL) THEN 'finished' WHEN (encounterPeriodStartDate > CURRENT_TIMESTAMP AND encounterPeriodStartDate IS NOT NULL) OR encounterStatus IN ('P') THEN 'planned' WHEN encounterStatus IN ('A', 'S', 'W') THEN 'arrived' WHEN encounterPeriodStartDate IS NOT NULL AND encounterPeriodEndDate IS NULL THEN 'in-progress' ELSE 'unknown' END AS encounterStatusMapped, encounterStatus, encounterClassDesc, encounterClassCode, CASE WHEN ISNUMERIC(encounterTypeCode) <> 1 THEN NULL ELSE UPPER(encounterTypeDesc) END AS encounterTypeDesc, CASE WHEN ISNUMERIC(encounterTypeCode) <> 1 THEN NULL ELSE encounterTypeCode END AS encounterTypeCode, CONCAT(COALESCE(encounterPeriodStartDate, ''), 'T', COALESCE(encounterPeriodStartTime, '')) AS encounterPeriodStart, CONCAT(COALESCE(encounterPeriodEndDate, ''), 'T', COALESCE(encounterPeriodEndTime, '')) AS encounterPeriodEnd, subjectReference, CONCAT(COALESCE(lastUpdateDate, ''), 'T', COALESCE(lastUpdateTime, '')) AS lastUpdated FROM encounter_CTE;");
	case 'medicationstatement':
		return executeCachedQuery();
	case 'patient':
		return executeCachedQuery("SELECT DISTINCT nhsNumber, nhsNumberTraceStatusDesc, nhsNumberTraceStatusCode, PatientNo, active, ethnicCategoryDesc, ethnicCategoryCode, homePhone, businessPhone, mobilePhone, appointmentSMS, email, preferredContactMethod, preferredLanguage, interpreterRequired, nameFamily, nameGiven1First, nameGiven2Middle, namePrefix, maritalStatusDesc, maritalStatusCode, addressLine1, addressLine2, city, district, postalCode, LOWER(gender) AS gender, birthdate, deceased, gpDesc, gpAddressLine1, gpAddressLine2, gpCity, gpPostalCode, gpIdentifier, contactName, contactPhone, contactText, dnd.DND, CONCAT(COALESCE(lastUpdateDate, ''), 'T', COALESCE(lastUpdateTime, '')) AS lastUpdated FROM OPENQUERY( [ENYH-PRD-ANALYTICS], 'SELECT DISTINCT patmas.PAPMI_PAPER_DR->PAPER_ID AS nhsNumber, patmas.PAPMI_TraceStatus_DR->TRACE_Desc AS nhsNumberTraceStatusDesc, patmas.PAPMI_TraceStatus_DR AS nhsNumberTraceStatusCode, patmas.PAPMI_No AS PatientNo, patmas.PAPMI_Active, CASE WHEN patmas.PAPMI_Active IS NULL THEN ''true'' WHEN patmas.PAPMI_Active = ''Y'' THEN ''true'' ELSE NULL END AS active, patmas.PAPMI_PAPER_DR->PAPER_IndigStat_DR->INDST_Desc AS ethnicCategoryDesc, patmas.PAPMI_PAPER_DR->PAPER_IndigStat_DR->INDST_Code AS ethnicCategoryCode, patmas.PAPMI_PAPER_DR->PAPER_TelH AS homePhone, patmas.PAPMI_PAPER_DR->PAPER_TelO AS businessPhone, patmas.PAPMI_PAPER_DR->PAPER_MobPhone AS mobilePhone, patmas.PAPMI_PAPER_DR->PAPER_AppointmentSMS AS appointmentSMS, patmas.PAPMI_PAPER_DR->PAPER_Email AS Email, patmas.PAPMI_PAPER_DR->PAPER_PreferredContactMethod AS PreferredContactMethod, patmas.PAPMI_PAPER_DR->PAPER_PrefLanguage_DR->PREFL_Desc AS PreferredLanguage, patmas.PAPMI_PAPER_DR->PAPER_InterpreterRequired AS InterpreterRequired, patmas.PAPMI_PAPER_DR->PAPER_UpdateDate AS lastUpdateDate, patmas.PAPMI_PAPER_DR->PAPER_UpdateTime AS lastUpdateTime, patmas.PAPMI_PAPER_DR->PAPER_Name AS nameFamily, patmas.PAPMI_PAPER_DR->PAPER_Name2 AS nameGiven1First, patmas.PAPMI_PAPER_DR->PAPER_Name3 AS nameGiven2Middle, patmas.PAPMI_PAPER_DR->PAPER_Title_DR->TTL_Desc AS nameprefix, patmas.PAPMI_PAPER_DR->PAPER_NokName AS contactName, patmas.PAPMI_PAPER_DR->PAPER_NokPhone AS contactPhone, patmas.PAPMI_PAPER_DR->PAPER_NokText AS contactText, CASE patmas.PAPMI_PAPER_DR->PAPER_Marital_DR->CTMAR_RowId WHEN 1 THEN ''Married'' WHEN 2 THEN ''unknown'' WHEN 3 THEN ''Widowed'' WHEN 4 THEN ''unmarried'' WHEN 5 THEN ''Legally Seperated'' WHEN 6 THEN ''Divorced'' END AS maritalStatusDesc, CASE patmas.PAPMI_PAPER_DR->PAPER_Marital_DR->CTMAR_Code WHEN ''N'' THEN ''U'' ELSE patmas.PAPMI_PAPER_DR->PAPER_Marital_DR->CTMAR_Code END AS maritalStatusCode, patmas.PAPMI_PAPER_DR->PAPER_StName AS addressLine1, patmas.PAPMI_PAPER_DR->PAPER_ForeignAddress AS addressLine2, patmas.PAPMI_PAPER_DR->PAPER_CityCode_DR->CTCIT_Desc AS city, patmas.PAPMI_PAPER_DR->PAPER_CT_Province_DR->PROV_Desc AS district, patmas.PAPMI_PAPER_DR->PAPER_Zip_DR->CTZIP_Code AS postalCode, CASE patmas.PAPMI_PAPER_DR->PAPER_Sex_DR->CTSEX_RowId WHEN 1 THEN ''female'' WHEN 2 THEN ''unknown'' WHEN 3 THEN ''other'' WHEN 4 THEN ''male'' END AS gender, patmas.PAPMI_DOB AS birthDate, CASE WHEN patmas.PAPMI_PAPER_DR->PAPER_Deceased = ''Y'' THEN ''true'' WHEN patmas.PAPMI_PAPER_DR->PAPER_Deceased = ''N'' THEN NULL END AS deceased, patmas.PAPMI_PAPER_DR->PAPER_FamilyDoctor_DR->REFD_Desc AS gpDesc, patmas.PAPMI_PAPER_DR->PAPER_FamilyDoctorClinic_DR->CLN_Address1 AS gpAddressLine1, patmas.PAPMI_PAPER_DR->PAPER_FamilyDoctorClinic_DR->CLN_Address2 AS gpAddressLine2, patmas.PAPMI_PAPER_DR->PAPER_FamilyDoctorClinic_DR->CLN_City_DR->CTCIT_Desc AS gpCity, patmas.PAPMI_PAPER_DR->PAPER_FamilyDoctorClinic_DR->CLN_Zip_DR->CTZIP_Code AS gpPostalCode, patmas.PAPMI_PAPER_DR->PAPER_FamilyDoctorClinic_DR->CLN_Code AS gpIdentifier, patmas.PAPMI_VIPFlag AS restrictedPatient FROM %ALLINDEX PA_PatMas patmas WHERE " + params[0] + " AND COALESCE(PAPMI_Active,''Y'') = ''Y'' AND (patmas.PAPMI_PAPER_DR->PAPER_ID IS NOT NULL OR patmas.PAPMI_No IS NOT NULL)') AS patient LEFT JOIN OPENQUERY([ENYH-PRD-ANALYTICS], 'SELECT DISTINCT ALM_PAPMI_ParRef->PAPMI_PAPER_DR->PAPER_ID AS DND FROM PA_AlertMsg WHERE ALM_Alert_DR->ALERT_Desc IN (''Do not disclose patient address'') AND (ALM_ClosedDate IS NULL OR ALM_ClosedDate < CURRENT_TIMESTAMP)') AS dnd ON patient.nhsNumber = dnd.DND;");
	default:
		break;
	}
}
